import { createSlice } from "@reduxjs/toolkit";

const initialState = {
  store: {
    data: [],
    isDataReceived: false,
    reRunComponent: true,
  },
};

const shopSlice = createSlice({
  name: "shop",
  initialState,
  reducers: {},
});
export default shopSlice;
